import React from 'react'
import FooterImg from '../assets/footer.webp'
import styled from 'styled-components'

const Container = styled.footer`
    margin-top: -3em;
    padding-bottom: 40px;
    padding-top: 3em;
    position: relative;
    width: 100%;

    &:before{
        background: url(${FooterImg}) no-repeat scroll bottom transparent;
        background-size: 100% 1200px;
        bottom: 0;
        content: "";
        height: 100%;
        left: 0;
        position: absolute;
        width: 100%;
        z-index: -2;    
    }
`;

const SubContainer = styled.div`
    margin: auto;
    max-width: 1300px;
    padding: 0;
    width: 90%;
`

const Container3 = styled.div`
    padding-bottom: 3em;
    padding-top: 3em;
`

const Container4 = styled.div`
    padding-right: 3em;
`

const Title = styled.h2`
    color: #fff;
    font-family: Ruberoid;
    font-weight: 700;
    letter-spacing: 0;
    margin-bottom: 20px;
    font-size: 40px;
    line-height: 48px;
`

function Footer() {
  return (
    <Container>
        <SubContainer>
            {/* <Container3> */}
                <Container4>
                    <Title>Subscribe to our newsletter</Title>
                </Container4>
            {/* </Container3> */}
        </SubContainer>
        <h2>Hello</h2>
    </Container>
  );
}

export default Footer;
